INSERT INTO `movies` VALUES (83,'Nhất niệm vĩnh hằng',5,24,'Mạo Nhi Sơn là một ngọn núi ở bên trong Đông Lâm sơn mạch. Ở dưới núi có một thôn làng, dân phong ở đây thuần phác, thường cày ruộng mà sống, đoạn tuyệt với thế giới bên ngoài. Một buổi sáng sớm... Ở trước cổng chính của thôn trang, toàn bộ hương thân trong thôn đang đứng tiễn đưa một thiếu niên chừng mười lăm mười sáu tuổi. Thiếu niên này trông gầy yếu nhưng trắng trẻo sạch sẽ, thoạt nhìn rất là nhu thuận. Y phục trên người hắn chỉ là một bộ thanh sam bình thường nhưng đã bị phai màu trở thành màu trắng, hai mắt toát lên vẻ lanh lợi, trong sáng. Hắn tên là Bạch Tiểu Thuần.','Mao Nhi Son is a mountain in the Dong Lam mountain range. In the bottom of the mountain, there is a village, the people here are pure and simple, often plowing the fields to live, cut off from the outside world. One early morning... In front of the main gate of the village, all the relatives in the village were standing to see off a boy about fifteen or sixteen years old. This young man looked thin, but white and clean, and at first glance was very docile. The clothes on his body were just an ordinary fir but had faded to white, his eyes exuding alertness and clarity. His name is Bai Xiaochun.',0,1,0,'2023-06-22 00:24:37',NULL,NULL,1),(84,'Overlord',5,24,'Cốt truyện anime sẽ đưa khán giả đến năm 2138 trong tương lai, khi khoa học công nghệ phát triển vượt bậc và ngành game thực tế ảo đang nở rộ hơn bao giờ hết. Yggdrasil, một game online vô cùng phổ biến thời gian đó bỗng dưng bị đóng cửa đột ngột, nhưng nhân vật chính Momonga lại quyết định không thoát ra ngoài và khám phá những điều bí ẩn khi thế giới ảo quanh mình ngày một thay đổi.','The anime plot will take the audience to the year 2138 in the future, when science and technology has advanced dramatically and the virtual reality game industry is blooming like never before. Yggdrasil, an extremely popular online game at that time, was suddenly closed, but the main character Momonga decided not to go out and explore the mysteries when the virtual world around him changed day by day.',0,2,12000,'2023-06-22 00:33:22',NULL,NULL,1),(85,' Sakurasou no Pet na Kanojo',5,24,'Là chuyển thể của light novel cùng tên, chuyện kể về Sorata Kanda, 1 nam sinh sống tại Sakurasou – 1 ngôi nhà tập thể dành cho những đứa trẻ lập dị. 1 ngày kia có 1 cô tên Mashiro Shiina chuyển tới sống, cô là 1 họa sĩ xuất sắc nhưng lại rất vụng về và không thể tự chăm lo bản thân. Vì thế Sorata được giao phó công việc quản thúc Mashiro.','Adapted from the light novel of the same name, the story follows Sorata Kanda, a male living in Sakurasou - a dormitory for eccentric children. One day, a girl named Mashiro Shiina moved in, she was an excellent painter but was very clumsy and could not take care of herself. So Sorata was entrusted with the job of containing Mashiro.',0,2,24000,'2023-06-22 00:38:13',NULL,NULL,1),(86,'Date a live',5,24,'Trước khi tận thế , hãy giết hoặc hôn em đi 30 năm trước, một hiện tượng kỳ lạ được gọi là \"không gian chấn\" đã tàn phá trung tâm của lục địa Á-Âu, đe dọa mạng sống của ít nhất 150 triệu người. Từ đó, những trận không chấn nhỏ hơn đã làm thế giới trở nên bất thường.Itsuka Shidou là một học sinh trung học bình thường. Thế nhưng, trong ngày đầu tiên đi học trở lại sau kỳ nghỉ xuân, một đợt không gian chấn giáng xuống thành phố. Shidou, đi tìm em gái trong thiên tai, đã gặp gỡ một cô gái cầm trọng kiếm sau một cơn không gian chấn.Em gái của Shidou, Kotori, sau đó tiết lộ với cậu cô gái đó là một sinh vật gọi là tinh linh và là nguyên nhân gây ra các đợt không gian chấn. Đồng thời Kotori cũng tiết lộ mình là một trong những lãnh đạo của tổ chức Ratatoskr có nhiệm vụ ngăn chặn những hiểm họa tinh linh. Sau đó cô mời Shidou gia nhập tổ chức với nhiệm vụ phong ấn năng lượng của các tinh linh. Với điều kiện tiên quyết là cậu phải hẹn hò với các cô gái và khiến họ yêu cậu.','Before the apocalypse, kill or kiss me 30 years ago, a strange phenomenon known as \"space quake\" ravaged the center of Eurasia, threatening the lives of at least 150 million people. . Since then, smaller air quakes have made the world abnormal. Itsuka Shidou is an ordinary high school student. However, on the first day back to school after spring break, a spacequake hits the city. Shidou, searching for his sister during the disaster, met a girl wielding a heavy sword after a space quake. Shido\'s younger sister, Kotori, later revealed to the girl to be a being called a spirit. and is the cause of space earthquakes. At the same time, Kotori also reveals herself to be one of the leaders of the Ratatoskr organization whose mission is to prevent spiritual threats. She then invites Shidou to join the organization with the task of sealing the energy of the spirits. With the precondition that he must date girls and make them fall in love with him.',0,2,20000,'2023-06-22 00:42:40',NULL,NULL,1),(87,'Youkoso Jitsuryoku Shijou Shugi no Kyoushitsu e',2,24,'Trường trung học Koudo Ikusei là một trường hàng đầu có uy tín với các cơ sở hiện đại, nơi có gần 100% sinh viên đi học đại học hoặn tìm được việc làm. Các sinh viên có quyền tự do mặc bất cứ gì và để bất kỳ kiểu tóc nào. Koudo Ikusei là một trường thiên đường, nhưng sự thật là chỉ có cấp trên của sinh viên được đối xử tốt','Koudo Ikusei High School is a prestigious top school with state-of-the-art facilities where nearly 100% of students go to university or find employment. Students have the freedom to wear anything and have any hairstyle. Koudo Ikusei is a heavenly school, but the truth is that only the superiors of students are treated well',0,1,0,'2023-06-22 00:47:19',NULL,NULL,1),(88,'Shigatsu wa Kimi no Uso',5,24,'Câu chuyện kể về Arima Kosei, một thần đồng piano. Nhưng kể từ sau chấn động tâm lí do cái sự qua đời của mẹ cậu, Kosei đã không thể nghe thấy bất kì âm thanh nào. Cứ tưởng là cậu sẽ không bao giờ động vào những phím piano nữa nhưng đó là trước khi cậu đã gặp Miyazono Kawori...','The story is about Arima Kosei, a piano prodigy. But since the trauma caused by the death of his mother, Kosei has not been able to hear any sound. Thought he would never touch the piano keys again but that was before he met Miyazono Kawari...',0,1,0,'2023-06-22 00:50:26',NULL,NULL,1),(89,'Fights Break Spheres',5,24,'Phim chuyển thể từ tiểu thuyết cùng tên của tác giả Thiên Tàm Thổ Đậu. Tiêu Viêm là thiên tài tu luyện đấu khí của nhà họ Tiêu, 11 tuổi đã đột phá Thập Đoạn Đấu Chi Khí, trở thành đấu thủ trẻ tuổi nhất của gia tộc suốt trăm năm qua. Nhưng đến năm 12 tuổi, Tiêu Viêm bất ngờ mất đi khả năng tu luyện, chỉ còn lại Tam Đoạn Đấu Chi Khí. Trong 3 năm sau đó, nhà họ Tiêu cũng liên tiếp gặp nhiều bất trắc. Đúng vào lúc Tiêu Viêm tuyệt vọng nhất, một linh hồn xuất hiện từ trong chiếc nhẫn trên tay Tiêu Viêm, mở ra trước mắt Tiêu Viêm một cánh cửa hoàn toàn mới. Dưới sự giúp đỡ của Dược lão, Tiêu Viêm đã hồi phục và nâng cao được công lực của mình, đánh bại Nạp Lan Yên Nhiên khi giao hẹn ba năm đến. Nhưng không may là cha Tiêu Viêm lại bị Vân Lam tông bắt đi, Tiêu Viêm lại bắt đầu cuộc hành trình nhiều thử thách nhằm cứu thoát cha mình…','The film is adapted from the novel of the same name by the author Thien Tam Tho Dau. Xiao Yan is the genius of the Xiao family\'s dou qi cultivation, 11 years old broke through the Ten Duan Dou Chi Chi, becoming the youngest player of the family in the past hundred years. But at the age of 12, Tieu Viem suddenly lost the ability to cultivate, leaving only Tam Duan Dou Chi Chi. In the next 3 years, the Tieu family also faced many problems. Right at the moment when Xiao Yan was most desperate, a soul appeared from the ring on Xiao Yan\'s hand, opening a completely new door in front of Xiao Yan\'s eyes. With Elder Medicine\'s help, Xiao Yan recovered and improved his gong, defeating Nalan Yanran on a three-year appointment. But unfortunately, Tieu Viem\'s ​​father was taken away by the Van Lam sect, and Tieu Viem began a challenging journey to save his father...',0,1,0,'2023-06-22 00:54:06','2023-06-22 01:53:54',NULL,1),(90,'Jujutsu Kaisen',5,24,'Trong một thế giới nơi những con quỷ ăn thịt người không nghi ngờ gì, những mảnh vỡ của con quỷ huyền thoại và đáng sợ Ryoumen Sukuna đã bị thất lạc và nằm rải rác. Nếu bất kỳ con quỷ nào tiêu thụ các bộ phận cơ thể của Sukuna, sức mạnh mà chúng có được có thể phá hủy thế giới như chúng ta đã biết. May mắn thay, có một ngôi trường bí ẩn của các Phù thủy Jujutsu tồn tại để bảo vệ sự tồn tại bấp bênh của người sống khỏi xác sống!Yuuji Itadori là một học sinh trung học dành cả ngày để thăm ông nội nằm liệt giường của mình. Mặc dù anh ấy trông giống như một thiếu niên bình thường của bạn, nhưng sức mạnh thể chất to lớn của anh ấy là một điều đáng chú ý! Mọi câu lạc bộ thể thao đều muốn cậu tham gia, nhưng Itadori thà đi chơi với những đứa trẻ bị trường ruồng bỏ trong Câu lạc bộ huyền bí. Một ngày nọ, câu lạc bộ quản lý để có được bàn tay của họ trên một vật thể bị nguyền rủa bị phong ấn, nhưng họ ít biết nỗi kinh hoàng mà họ sẽ gây ra khi phá vỡ phong ấn ...','In a world where demons eat man without a doubt, the fragments of the legendary and fearsome demon Ryoumen Sukuna have been lost and scattered. If any demons consume Sukuna\'s body parts, the power they gain could destroy the world as we know it. Fortunately, a mysterious school of Jujutsu Wizards exists to protect the precarious existence of the living from the undead! Yuuji Itadori is a high school student who spends his days visiting his bedridden grandfather. mine. Although he looks like your average teenager, his immense physical strength is something to behold! Every sports club wants him to join, but Itadori would rather hang out with the school outcasts in the Occult Club. One day, the club manage to get their hands on a sealed cursed object, but little do they know the horror they will cause when they break the seal...',0,1,0,'2023-06-22 00:57:08',NULL,NULL,1),(91,'The Daily Life of the Immortal King',5,0,'Chuyện nói về một anh chàng với tuổi thơ bắt đầu năm sáu tuổi, anh giết vua quỷ Swallow Sky Clam. Là một phù thủy tu luyện toàn năng, Tiên vương phải che giấu sức mạnh của mình và sống giữa một nhóm sinh viên tu luyện bình thường. Những người trẻ tuổi không quan tâm đến tiền bạc, nghệ thuật cổ tích, vũ khí ma thuật và danh tiếng mà những người bình thường tìm kiếm. Bất chấp sự ngưỡng mộ của Sun Rong giàu có, tay súng bắn tỉa giết người hàng đầu của Yingliu và sự kiên quyết không ngừng của cha mẹ, anh ta không thể ngừng theo đuổi món mì giòn. Hoặc là ăn mì giòn ằng ngày mà anh yêu thích, hoặc trên đường đến cửa hàng mì giòn. Bằng cách này, anh và bốn đồng đội gặp phải thử thách của trường trung học trong trò chơi kiếm thuật, và thủ lĩnh phù thủy bóng tối Jiang Liuying, người đã thất bại trong vụ ám sát được ghi cụ thể trong cuốn nhật ký hằng ngày của tiên vương mà cất giữ trong họp bí mật bất lâu nay, đã không bỏ cuộc và tham gia. Will Wang Ling đè bẹp đối thủ và mong chờ được sự đổi mới.','The story is about a guy whose childhood begins at the age of six, he kills the demon king Swallow Sky Clam. As an almighty cultivation wizard, the Fairy King must hide his power and live among a group of ordinary cultivation students. Young people don\'t care about the money, fairy arts, magic weapons, and fame that ordinary people seek. Despite the admiration of wealthy Sun Rong, Yingliu\'s top killer sniper, and his parents\' unwavering determination, he can\'t stop pursuing crispy noodles. Either eating his favorite crispy noodles every day, or on the way to the crispy noodle shop. In this way, he and four comrades meet the high school\'s challenge in the game of swordsmanship, and the leader of the dark wizard Jiang Liuying, whose assassination attempt is specifically recorded in the daily diary. The day of the first king, which had been kept in secret for a long time, did not give up and participated. Will Wang Ling crushes the competition and looks forward to innovation.',0,1,0,'2023-06-22 00:59:41','2023-06-22 01:13:18',NULL,1),(92,'Tenki no Ko',1,1,'Mùa hè năm đầu cấp Ba, Hodaka bỏ nhà ra đi. Cậu từ một hòn đảo xa xôi hẻo lánh đến Tokyo, nhưng sau đó nhanh chóng rơi vào cảnh túng thiếu và phải sống chuỗi ngày cô đơn. Nhưng cuối cùng cậu đã tìm được công việc: viết bài cho một tạp chí huyền bí. Sau khi cậu bắt đầu công việc, mưa cứ rơi mãi rơi mãi không thôi. Ở một góc thành phố đông đúc và nhộn nhịp, Hodaka đã gặp thiếu nữ tên Hina. Cô sống cùng em trai, luôn vui vẻ và kiên cường. Cô cũng có một sức mạnh vô cùng đặc biệt: “Này, từ bây giờ trời hãy hửng nắng đi nào.” Từng chút một, mưa ngừng rơi, và ánh sáng tuyệt đẹp rọi chiếu những nóc nhà trong thành phố. Chỉ bằng một lời cầu nguyện, cô đã khiến bầu trời trở nên sáng trong.','The summer of his first year of high school, Hodaka ran away from home. He came from a remote island to Tokyo, but soon fell into poverty and had to live a lonely life. But he finally found a job: writing for a paranormal magazine. After he started working, the rain kept falling. In a corner of the crowded and bustling city, Hodaka met a young woman named Hina. She lives with her younger brother, always cheerful and resilient. She also has a very special power: \"Hey, let\'s get sunny from now on.\" Little by little, the rain stopped falling, and a beautiful light shone on the rooftops of the city. With just one prayer, she made the sky clear.',0,2,25000,'2023-06-22 01:05:05',NULL,NULL,1);
