INSERT INTO `producers` VALUES (1,'J.C.Staff',NULL,'2023-03-17 14:32:40',NULL,NULL,1),(2,'Mappa',NULL,'2023-03-17 14:32:56',NULL,NULL,1),(5,'Kyoto Animation','Kyoto Animation (còn được biết tới là KyoAni) là một xưởng phim uy tín tại Nhật Bản. Khác với các xưởng phim khác thường được đặt tại Tokyo, Kyoto Animation có trụ sở tại Kyoto – vùng đất cổ kính của Nhật với rất nhiều đền thờ Phật giáo, đền thờ Thần đạo, cung điện cổ, vườn,... Có lẽ cũng chính vì vậy nên phong cách sản xuất anime của Kyoto Animation cũng có những nét riêng biệt không nhầm lẫn với các xưởng anime khác. Các tác phẩm của KyoAni thường mang nét mang mác buồn và thường ẩn chứa những bài học hay thực trạng trong cuộc sống như nạn bắt nạt học đường, trầm cảm tự sát,... khiến khán giả sau khi xem xong phải suy ngẫm.','2023-06-22 00:29:04',NULL,NULL,1),(6,'Madhouse','Madhouse được biết đến là một xưởng anime với bề dày lịch sử trong ngành công nghiệp anime. Tính đến nay, đã có hàng trăm bộ anime dài tập được sản xuất, một trong số đó đã trở thành huyền thoại trong giới. Một số bộ anime nổi tiếng của hãng có lẽ bạn đã từng xem: One Punch Man (2015), Monster (2004), Kiseijuu: Sei no Kakuritsu (2014), Death Note (2006),...','2023-06-22 00:29:45',NULL,NULL,1);
